Khanak () is a rural locality (a selo) in Guninsky Selsoviet, Tabasaransky District, Republic of Dagestan, Russia. Population:  There are 4 streets.
Geography
Khanak is located 20&nbsp;km southwest of Khuchni (the district's administrative centre) by road. Bukhnag is the nearest rural locality.
